import React from "react";
import { useNavigate } from "react-router-dom";

const Main:React.FC = ()=>{

    const mainData = async (e:any) => {

        try{
            const res = await fetch("http://localhost:1234/getData", {
                method:"POST",
                mode:"cors",
                headers: {
                    'Content-Type': 'application/json',
                },
            })

            return await res.json()

        }catch(err){
            console.log("ERROR:",err)
        }
    }

    const Data = mainData

    return (
        <div id="center">{mainData.toString()}</div>
    )
}

export default Main;
